import React from 'react';
import { LoginForm } from "modules"
import { Router, Route } from "react-router-dom"

import "./Auth.scss"

const Auth = () => {
    return (
        <section className="auth">
            <div className="auth__content">
                <Router>
                    <Route path="/:(|/login)" element={<LoginForm></LoginForm>}></Route>
                </Router>
            </div>
        </section>
    );
};

export default Auth;
